function PostList(props) {
  const posts = props.posts


  return (
    <div className='post-list'>
      {posts.map(post => (
        <div key={post.id}>
          <h4>{post.title}</h4>
          <p>{post.body}</p>
          <span>Wed jun 23 2021</span>
        </div>
       ))}
    </div>
  )

}

export default PostList;
